import "./App.css";
import CountryComponent from "./components/CountryComponent";
import { CountryProvider } from "./contexts/CountryContext";

function App() {
  return (
    <div className="App">
      <CountryProvider>
        <CountryComponent></CountryComponent>
      </CountryProvider>
    </div>
  );
}

export default App;
